(9, 'Email For Reported By Other Users', '<table class=\"TextContentContainer\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"TextContent\" style=\"font-family: arial; padding: 30px 18px 9px 18px;\" valign=\"top\"><strong><span style=\"color: #5db3a5;\"><span style=\"font-size: 20px; line-height: 32px;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"assets/admin/EmailImg/rapidlogo.png\" alt=\"\" width=\"100\" height=\"100\" /></span></span></strong>\r\n<p style=\"line-height: 23px; margin: 0px; font-size: 14px; text-align: left;\">Hello: <strong>[username]</strong>,</p>\r\n<p style=\"line-height: 23px; margin: 0px; font-size: 14px; text-align: left;\">&nbsp;</p>\r\n<p style=\"line-height: 23px; margin: 0px; font-size: 14px; text-align: left;\">Account has been blocked as per your report of user <strong>[reported_user]</strong>.</p>\r\n<p style=\"line-height: 23px; margin: 0px; font-size: 14px; text-align: left;\">&nbsp;</p>\r\n<p style=\"line-height: 23px; margin: 0px; font-size: 14px; text-align: left;\">&nbsp;</p>\r\n<p style=\"line-height: 23px; margin: 0px; font-size: 14px; text-align: left;\">Thanks &amp; Regards</p>\r\n<p style=\"line-height: 23px; margin: 0px; font-size: 14px; text-align: left;\">Team Rapid Chat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'text');
